from typing import List

class Solution:
    def maxNumberOfAlloys(self, n: int, k: int, budget: int, composition: List[List[int]], stock: List[int], cost: List[int]) -> int:
        def alloysCanBeMade(machine: int, alloys: int) -> bool:
            total_cost = 0
            for metal in range(n):
                metal_needed = alloys * composition[machine][metal] - stock[metal]
                if metal_needed > 0:
                    total_cost += metal_needed * cost[metal]
            return total_cost <= budget

        max_alloys = 0
        for machine in range(k):
            low, high = 0, budget
            while low <= high:
                mid = (low + high) // 2
                if alloysCanBeMade(machine, mid):
                    max_alloys = max(max_alloys, mid)
                    low = mid + 1
                else:
                    high = mid - 1
        return max_alloys
